import React, { useState } from 'react';
import { DragDropContext, Droppable, Draggable } from '@hello-pangea/dnd';

const initialFields = [
  { id: 'field-1', label: 'First Name', type: 'text', placeholder: 'Enter your first name', required: false },
  { id: 'field-2', label: 'Email', type: 'email', placeholder: 'Enter your email', required: true },
  { id: 'field-3', label: 'Date of Birth', type: 'date', placeholder: '', required: true }
];

const TextInput = ({ field, handleFieldChange }) => (
  <div>
    <label>{field.label}</label>
    <input
      type={field.type}
      placeholder={field.placeholder}
      required={field.required}
      onChange={(e) => handleFieldChange(e, field.id)}
    />
  </div>
);

const FieldEditor = ({ field, handleFieldUpdate }) => (
  <div style={{ margin: '10px 0', padding: '10px', border: '1px solid #ddd' }}>
    <h3>Edit Field</h3>
    <div>
      <label>Label: </label>
      <input 
        type="text" 
        value={field.label} 
        onChange={(e) => handleFieldUpdate(e, field.id, 'label')} 
      />
    </div>
    <div>
      <label>Placeholder: </label>
      <input 
        type="text" 
        value={field.placeholder} 
        onChange={(e) => handleFieldUpdate(e, field.id, 'placeholder')} 
      />
    </div>
    <div>
      <label>Required: </label>
      <input 
        type="checkbox" 
        checked={field.required} 
        onChange={(e) => handleFieldUpdate(e, field.id, 'required')} 
      />
    </div>
  </div>
);

const FormBuilder = () => {
  const [fields, setFields] = useState(initialFields);
  const [selectedField, setSelectedField] = useState(null);

  // Handle drag and drop logic
  const onDragEnd = (result) => {
    const { destination, source } = result;
    if (!destination) return;

    const reorderedFields = Array.from(fields);
    const [removed] = reorderedFields.splice(source.index, 1);
    reorderedFields.splice(destination.index, 0, removed);

    setFields(reorderedFields);
  };

  const handleFieldChange = (e, fieldId) => {
    const updatedFields = fields.map((field) =>
      field.id === fieldId ? { ...field, value: e.target.value } : field
    );
    setFields(updatedFields);
  };

  const handleFieldUpdate = (e, fieldId, property) => {
    const updatedFields = fields.map((field) => {
      if (field.id === fieldId) {
        return { ...field, [property]: e.target.type === 'checkbox' ? e.target.checked : e.target.value };
      }
      return field;
    });
    setFields(updatedFields);
  };

  const selectFieldForEditing = (fieldId) => {
    const fieldToEdit = fields.find((field) => field.id === fieldId);
    setSelectedField(fieldToEdit);
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Form Builder</h1>

      {/* Form for Editing Fields */}
      {selectedField && (
        <FieldEditor 
          field={selectedField} 
          handleFieldUpdate={handleFieldUpdate}
        />
      )}

      <DragDropContext onDragEnd={onDragEnd}>
        <Droppable droppableId="droppable-fields">
          {(provided) => (
            <div
              ref={provided.innerRef}
              {...provided.droppableProps}
              style={{
                display: 'flex',
                flexDirection: 'column',
                gap: '10px',
                width: '300px',
                border: '1px solid black',
                padding: '20px',
              }}
            >
              {fields.map((field, index) => (
                <Draggable key={field.id} draggableId={field.id} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      style={{
                        ...provided.draggableProps.style,
                        padding: '10px',
                        backgroundColor: '#f0f0f0',
                        border: '1px solid gray',
                        borderRadius: '5px',
                      }}
                      onClick={() => selectFieldForEditing(field.id)}
                    >
                      <TextInput 
                        field={field} 
                        handleFieldChange={handleFieldChange} 
                      />
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      </DragDropContext>
    </div>
  );
};

export default FormBuilder;
